import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import PrivateRoute from './Components/PrivateRoute';
import StudentDashboard from './Components/StudentDashboard';
import WardenDashboard from './Components/WardenDashboard';
import Login from './Components/Login';
import { AuthProvider } from './contexts/AuthContext';

function App() {
  return (
    <Router>
    <AuthProvider>
    <Routes>
    
        {/* <Route exact path="/login" component={Login} />
        <PrivateRoute path="/student-dashboard" component={StudentDashboard} />
        <PrivateRoute path="/warden-dashboard" component={WardenDashboard} /> */}
    
        {/* <Route path="*" element={<Login />} /> */}
        <Route path="/login" element={<Login />} />
        <Route 
          path="/student-dashboard" 
          element={<PrivateRoute><StudentDashboard /></PrivateRoute>} 
        />
        <Route 
          path="/warden-dashboard" 
          element={<PrivateRoute><WardenDashboard /></PrivateRoute>} 
        />
      </Routes>
    </AuthProvider>
    </Router>

  );
}

export default App;
